import React from 'react';
import {
  AppBar,
  Toolbar,
  Typography,
  Button,
  Box,
} from '@mui/material';
import {
  Security,
  CloudUpload,
  Rule,
  Scanner,
} from '@mui/icons-material';
import { useNavigate, useLocation } from 'react-router-dom';

const Navbar: React.FC = () => {
  const navigate = useNavigate();
  const location = useLocation();

  const navItems = [
    { label: 'Scanner', path: '/scanner', icon: <Scanner /> },
    { label: 'Log Analysis', path: '/logs', icon: <CloudUpload /> },
    { label: 'Rules', path: '/rules', icon: <Rule /> },
  ];

  return (
    <AppBar 
      position="static" 
      elevation={0}
      sx={{
        backgroundColor: '#ffffff',
        border: '3px solid #2d2d2d',
        borderBottom: '4px dashed #2d2d2d',
        borderRadius: '0 0 255px 15px / 0 0 15px 255px',
        transform: 'rotate(-0.2deg)',
        boxShadow: '0 4px 0px 0px #2d2d2d',
        position: 'relative',
        '&::before': {
          content: '"✏️"',
          position: 'absolute',
          top: 8,
          right: 20,
          fontSize: '1.5rem',
          transform: 'rotate(15deg)',
        },
        '&::after': {
          content: '""',
          position: 'absolute',
          top: 10,
          left: 20,
          width: 40,
          height: 8,
          backgroundColor: 'rgba(255, 255, 196, 0.8)', // Tape effect
          transform: 'rotate(-5deg)',
          border: '1px solid rgba(45, 45, 45, 0.2)',
        }
      }}
    >
      <Toolbar sx={{ minHeight: 80, px: 4 }}>
        {/* Hand-Drawn Logo */}
        <Box 
          sx={{ 
            display: 'flex', 
            alignItems: 'center', 
            mr: 6, 
            cursor: 'pointer',
            position: 'relative',
            '&:hover': {
              '& .logo-icon': {
                transform: 'rotate(5deg) scale(1.1)',
              },
              '& .logo-text': {
                color: '#ff4d4d',
                transform: 'rotate(1deg)',
              }
            },
            transition: 'all 0.1s ease',
          }}
          onClick={() => navigate('/dashboard')}
        >
          {/* Wobbly Icon Container */}
          <Box
            className="logo-icon"
            sx={{
              width: 48,
              height: 48,
              backgroundColor: '#ff4d4d',
              borderRadius: '255px 15px 225px 15px / 15px 225px 15px 255px',
              border: '3px solid #2d2d2d',
              display: 'flex',
              alignItems: 'center',
              justifyContent: 'center',
              mr: 2,
              transition: 'all 0.1s ease',
              transform: 'rotate(-2deg)',
              boxShadow: '2px 2px 0px 0px #2d2d2d',
            }}
          >
            <Security 
              sx={{ 
                fontSize: 24, 
                color: '#ffffff',
              }} 
            />
          </Box>

          <Box>
            <Typography 
              variant="h5" 
              component="div" 
              className="logo-text"
              sx={{ 
                fontFamily: '"Kalam", cursive',
                fontWeight: 700,
                color: '#2d2d2d',
                transition: 'all 0.1s ease',
                lineHeight: 1,
                transform: 'rotate(-0.5deg)',
              }}
            >
              Securon
            </Typography>
            <Typography 
              variant="caption" 
              sx={{ 
                color: '#2d2d2d',
                fontFamily: '"Patrick Hand", cursive',
                fontSize: '0.9rem',
                opacity: 0.7,
              }}
            >
              Security Platform
            </Typography>
          </Box>
        </Box>

        {/* Scribbled Divider */}
        <Box
          sx={{
            width: 2,
            height: 40,
            backgroundColor: '#2d2d2d',
            mr: 4,
            borderRadius: '50%',
            transform: 'rotate(2deg)',
          }}
        />

        {/* Navigation Items */}
        <Box sx={{ flexGrow: 1, display: 'flex', gap: 2 }}>
          {navItems.map((item, index) => (
            <Button
              key={item.path}
              onClick={() => navigate(item.path)}
              sx={{
                color: location.pathname === item.path ? '#ffffff' : '#2d2d2d',
                backgroundColor: location.pathname === item.path ? '#ff4d4d' : '#ffffff',
                border: '2px solid #2d2d2d',
                borderRadius: '255px 15px 225px 15px / 15px 225px 15px 255px',
                px: 3,
                py: 1.5,
                textTransform: 'none',
                fontFamily: '"Patrick Hand", cursive',
                fontSize: '1.1rem',
                fontWeight: 400,
                position: 'relative',
                transition: 'all 0.1s ease',
                transform: `rotate(${index % 2 === 0 ? '-1deg' : '1deg'})`,
                boxShadow: location.pathname === item.path ? '2px 2px 0px 0px #2d2d2d' : '3px 3px 0px 0px #2d2d2d',
                '&:hover': {
                  backgroundColor: '#ff4d4d',
                  color: '#ffffff',
                  transform: `rotate(${index % 2 === 0 ? '1deg' : '-1deg'}) scale(1.05)`,
                  boxShadow: '1px 1px 0px 0px #2d2d2d',
                },
                '&:active': {
                  boxShadow: 'none',
                  transform: `rotate(${index % 2 === 0 ? '1deg' : '-1deg'}) translate(3px, 3px)`,
                },
                '&::before': {
                  content: `"${index + 1}"`,
                  position: 'absolute',
                  top: -8,
                  right: -8,
                  width: 20,
                  height: 20,
                  backgroundColor: '#fff9c4', // Post-it yellow
                  border: '2px solid #2d2d2d',
                  borderRadius: '50%',
                  display: 'flex',
                  alignItems: 'center',
                  justifyContent: 'center',
                  fontSize: '0.8rem',
                  fontFamily: '"Kalam", cursive',
                  fontWeight: 700,
                  color: '#2d2d2d',
                  transform: 'rotate(15deg)',
                }
              }}
            >
              <Box sx={{ display: 'flex', alignItems: 'center', gap: 1 }}>
                {React.cloneElement(item.icon, {
                  sx: { 
                    fontSize: 20,
                    strokeWidth: 2.5,
                  }
                })}
                {item.label}
              </Box>
            </Button>
          ))}
        </Box>

        {/* Decorative Doodles */}
        <Box
          sx={{
            position: 'absolute',
            top: 15,
            right: 60,
            width: 30,
            height: 30,
            border: '2px dashed #2d2d2d',
            borderRadius: '50%',
            opacity: 0.3,
            transform: 'rotate(45deg)',
          }}
        />
        <Box
          sx={{
            position: 'absolute',
            bottom: 10,
            left: 100,
            fontSize: '1.2rem',
            transform: 'rotate(-10deg)',
            opacity: 0.4,
          }}
        >
          ⚡
        </Box>
      </Toolbar>
    </AppBar>
  );
};

export default Navbar;
